export function AddAttendanceForm() {
  
  const { students, getStudents } = useStudent();
  useEffect(() => {
    // eslint-disable-next-line react-hooks/exhaustive-deps
        getStudents()
    }, []);

    
  return (
    <>
      <TableStudentAdmin students={students} />
      <Button  content="Enviar" positive primary ali />
    </>
  )
}
